import React from "react";
import im1 from "../imagens/cblolLogo.png";
import im2 from "../imagens/logo.png";



const Footer = () => (
    <footer>
        <h2>Cuidado! o Shaco está na Espreita! Se esconda!</h2>
        <img className="" src={im1} />
        <img className="logo" src={im2} />
    </footer>
);

export default Footer;
